import "./ExtraStyle.css";
import whiteSelector from "./img/whileIcon.svg";
import Header from "F:\\Project_Home\\client\\src\\user\\authen\\ExtraInfo\\Header.js";
export function ExtraInfo() {
  return (
    <>
      <Header />
      <div className="flex">
        <div className="leftHalf">
          <div className="pickle">
            <ul>
            <li><h1>Personal info</h1><p>Complete personal informations</p> </li>
            <li><h1>Your Services</h1><p>Add at least one service that you provide</p> </li>
            <li><h1>Experiences</h1><p>Add experiences you went through them in your journey</p> </li>
            <li><h1>Preview </h1><p></p> </li>
            </ul>
          </div>
        </div>
        <div className="rightHalf"></div>
      </div>
    </>
  );
}
